import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './pages/Loginjs';
import Upload from './pages/Uploadjs';
import Chart from './pages/Chartjs';
import Dashboard from './pages/Dashboardjs';
import AdminPanel from './pages/Adminjs';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/loginjs" element={<Login />} />
        <Route path="/uploadjs" element={<Upload />} />
        <Route path="/chartjs" element={<Chart />} />
        <Route path="/dashboardjs" element={<Dashboard />} />
        <Route path="/adminjs" element={<AdminPanel />} />
      </Routes>
    </Router>
  );
}

export default App;
